overview:
Курс «Алгоритмизация вычислений» будет вам интересен и просто необходим, если вы хотели бы изучить программирование с нуля и выйти на хороший базовый уровень, научиться составлять, понимать и анализировать алгоритмы.

В результате изучения курса вы сможете:
• записывать математическую постановку задачи;
• применять стандартные алгоритмы для решения задач;
• оценивать оптимальность алгоритмов и выбирать алгоритм, дающий лучшее решение задачи;
• проверять правильность алгоритма методом трассировки;
• кодировать алгоритмы с использованием технологии структурного программирования;
• отлаживать и тестировать программы.

Изучение данной дисциплины базируется на знании студентами основ математики, информатики и основ алгоритмизации в пределах программы средней школы, умении применять математический аппарат при выборе метода решения задачи.
Для освоения учебной дисциплины, студенты должны владеть школьными знаниями, получаемыми в процессе изучения указанных выше курсов.

Этот курс лежит в основе всего программирования. Можно сказать, что это фундамент, на котором будет строиться все дальнейшее обучение программированию. Мы будем решать задачи, постепенно переходя от простых к более сложным. В конечном итоге вы научитесь решать задачи обработки динамических списков, т.е. работать на хорошем базовом уровне.

Появились технические трудности? Обращайтесь на адрес: coursera@hse.ru

Hoy más que nunca, las corporaciones realizan grandes inversiones en el sector de la tecnología de la información Information Technology, IT). Aunque la calidad de estas inversiones afecta el trabajo cotidiano de millones de personas, es frecuente encontrar encuestas del sector con tasas de error en proyectos de IT superiores al 50 %. Es posible hacerlo mejor, y es posible hacerlo en forma consistente. En este curso de dos semanas de duración, analizaremos los principales desafíos del sector de IT corporativo y veremos cómo abordarlos mediante el uso de pensamiento de diseño (“Design Thinking”), la metodología “Lean Startup” y los principios del manifiesto ágil como estructura de equipo.

Al finalizar este curso, desarrollado en la Escuela de Negocios Darden (Darden School of Business) de la Universidad de Virginia (University of Virginia) y dictado por profesores de la más alta jerarquía, podrás:
utilizar el modelo de negocio Canvas para orientar la estrategia de tu empresa y facilitar la aceptación de los interesados;
traducir tu trabajo en el modelo Canvas a actas de constitución específicas de IT;
elaborar de manera rápida prototipos de los procesos alineados a la estrategia para implementarlos en tu infraestructura de IT.

Para tener en cuenta: Este es un curso breve, de dos semanas de duración.

На основании международного образовательного стандарта Computer Science был разработан стандарт СПбГУ с тем же названием. В дополнение к вопросам, обозначенным в международном стандарте, в этом курсе рассказывается о разработках кафедры и родственных ей IT предприятий в области создания новых архитектур ЭВМ и технологий их программирования. В курсе рассказывается о базовых понятиях архитектур ЭВМ (арифметико-логическое устройство, память, регистры, устройство управления, ввод/вывод), истории их создания, архитектурных способах ускорения ЭВМ (водопровод, RISC, спекулятивное исполнение, предсказание переходов, многопроцессорные и многомашинные архитектуры), о нетрадиционных архитектурах (систолические структуры, мобильные телефоны, встроенные системы реального времени). В теме «HLL компьютеры» подробно рассказывается о HLL компьютере "Самсон", разработанном под руководством автора этого курса. От слушателей курса не требуется начать программировать на машине "Самсон", гораздо более интересно обсудить, почему выбрана именно такая архитектура, такая система команд, какие предложены оптимизации, чем предлагаемые архитектуры лучше существующих. В заключение рассказывается о двух конкретных наиболее популярных архитектурах ЭВМ (самая старая из ныне живущих архитектур мейфрейм IBM/360 и наиболее массовая современная архитектура ARM).

По завершении этого курса учащиеся будут:
Уметь:
- Разбираться в различных архитектурах ЭВМ, сравнивать их по длине кода, эффективность исполнения, оценивать сложность аппаратной реализации;
- На основании знания внутренней структуры компьютера, устройства его кэш-памяти, знания реализации шин, уметь оптимизировать свои программы;
- Спроектировать новую ЭВМ, хотя бы на бумаге.

Знать:
- Структурные схемы современных ЭВМ;
- Способы аппаратной реализации основных элементов ЭВМ;
- Принципы работы устройств ввода/вывода.

Владеть:
- Навыками ускорения программного обеспечения за счет знания внутренней организации кэш-памяти и шин;
- Навыками ускорения ввода/вывода;
- Способами рационального создания микропрограмм ЭВМ.

This course represents an introduction to algorithms with numbers, including linear algebra problems and arbitrary precision arithmetic, that appear virtually everywhere, from cryptography to audio processing. You will learn how to:
- implement the basic number theory algorithms like Euclidean algorithm that are basic building blocks for modern cryptography;
- work with large numbers arising in cryptography and high precision arithmetic;
- solve systems of linear equations that appear in many areas from designing electrical circuits to computer graphics;
- implement Fast Fourier Transform that is inevitable in signal processing.
Each module includes a programming assignment that will improve both your understanding of the topics and your programming skills.

This MOOC – a joint initiative between EIT Digital, Université de Nice Sophia-Antipolis / Université Côte d'Azur, and INRIA - introduces the Linked Data standards and principles that provide the foundation of the Semantic web. You will learn how to publish, obtain and use structured data directly from the Web. Learning the principles, languages, and standards to exchange data on the Web will enable you to design and produce new applications, products, and services that leverage the volume and variety of data the Web holds.

We divided this course into four parts that cover the core technical skills and competencies you need to master to be able to use the Web as a space for giant structure data exchange:
• in the first part, “Principals of a Web of Linked Data”: you will learn and practice the principles to publish and obtain data directly on the Web instead of Web pages;
• in the second part, “The RDF Data Model”: you will learn the standard data model for the Web and its syntaxes to publish and link data on the Web in your applications and services;
• in the third part, “SPARQL Query Language”: you will learn how to directly query and access data sources on the Web and obtain structured data relevant to your activity and domain;
• in the fourth and final part, “Integration of other Data Formats and Sources”: you will learn how the Web standards interact and interoperate with other data formats to allow the integration of a variety of data sources.

Each week alternates short videos and quizzes, as well as supplementary resources and forums to gradually progress through the different principles and standards.

After following this course successfully, you will have the skills to obtain focused and structured datasets from the Web that you can then use to augment your own datasets, enrich their dimensions, feed your applications, perform data mining, machine learning, and training, data analysis, AI processing and reasoning and other data management.

Este curso guiará você do manuseio de um único computador para uma frota inteira. A administração de sistemas é a área da TI responsável pela manutenção de sistemas de computador confiáveis em um ambiente multiusuário. Neste curso, você verá os serviços de infraestrutura que mantém todas as organizações, grandes e pequenas, funcionando. Vamos nos aprofundar na nuvem para entender tudo, desde as configurações de infraestrutura em nuvem mais comuns até o gerenciamento de recursos em nuvem. Você também aprenderá a gerenciar e configurar servidores e usar ferramentas específicas do mercado para gerenciar computadores e informações e a produtividade dos usuários. Por fim, você aprenderá a recuperar a infraestrutura de TI da sua organização no caso de um desastre.

Até o fim deste curso, você conseguirá:
● utilizar as práticas recomendadas para escolher hardware, fornecedores e serviços para sua organização;
● entender como os serviços de infraestrutura mais comuns que mantêm a organização
funcionando e como gerenciar os servidores de infraestrutura;
● entender como aproveitar a nuvem ao máximo na sua organização;
● gerenciar os computadores e usuários de uma organização usando os serviços de diretório, o Active
Directory e o OpenLDAP;
● escolher e gerenciar as ferramentas que sua organização usará;
● fazer backup dos dados da sua organização e aprender a recuperar sua infraestrutura de TI no caso de
um desastre;
● utilizar o conhecimento em administração de sistemas para planejar e melhorar processos de ambientes de TI.

Это первый курс программы, которая должна подготовить вас к роли специалиста IT-поддержки начального уровня. В нем вы познакомитесь с миром информационных технологий (или IT) и различными его компонентами, такими как аппаратное обеспечение компьютера, Интернет, ПО, устранение неполадок и поддержка клиентов. Мы покажем, как проходит собеседование для технического специалиста, и расскажем, как лучше к нему подготовиться. Курс охватывает целый ряд тем из сферы IT. Пройдя его, вы поймете, чего ждать от этой программы.

К концу этого курса вы:
● поймете, как устроена двоичная система счисления;
● соберете компьютер с нуля;
● выберете операционную систему и установите ее на компьютер;
● разберетесь, что такое Интернет, как он работает и какое влияние оказывает на современный мир;
● узнаете, как создаются приложения и как они работают "под капотом" компьютера;
● научитесь использовать методологии решения проблем и навыки коммуникации, необходимые в сфере информационных технологий.

Этот курс поможет вам ознакомиться с новейшими технологиями искусственного интеллекта. Инженеры по глубокому обучению сейчас широко востребованы, освойте методы глубокого обучения и перед вами откроются многочисленные карьерные возможности. Глубокое обучение также можно считать новой «сверхспособностью», с помощью которой вы будете строить такие ИИ-системы, которые невозможно было создать еще пару лет назад.

В этом курсе вы познакомитесь с основами глубокого обучения. После завершения курса вы:
- будете иметь представление об основных технологических тенденциях, движущих вперед область глубокого обучения;
- сможете строить, обучать и применять полносвязные глубокие нейронные сети;
- будете знать, как реализуются эффективные (векторизованные) нейросети;
- получите представление о ключевых параметрах архитектуры нейронной сети

Данный курс также позволяет разобраться, как в реальности действует глубокое обучение, а не просто дает его поверхностное описание. Поэтому после завершения курса вы сможете применять глубокое обучение в собственных приложениях. Если вы ищете работу в области ИИ, то после прохождения данного курса вы также сможете ответить на простые вопросы в ходе собеседования.

Это первый курс специализации «Глубокое обучение».

Vous souhaitez vous lancer dans l’IA de pointe ? Ce cours est là pour vous y aider. Les ingénieurs en Deep Learning sont très convoités et la maîtrise de ce domaine vous ouvrira de nombreuses opportunités professionnelles. Le Deep Learning est également un nouveau « superpouvoir » qui vous permettra de développer des systèmes d’IA qui n’étaient même pas envisageables il y a encore quelques années.

Vous découvrirez dans ce cours les bases du Deep Learning. Une fois que vous l’aurez terminé, vous serez en mesure de :
- comprendre les grandes tendances technologiques sur lesquelles repose le Deep Learning ;
- développer, entraîner et utiliser des réseaux neuronaux profonds entièrement connectés ;
- mettre en œuvre des réseaux neuronaux efficaces (vectorisés) ;
- comprendre les principaux paramètres de l’architecture d’un réseau neuronal.

Ce cours ne se limitera pas à une description rapide ou superficielle du Deep Learning, mais vous expliquera également son fonctionnement. Une fois que vous l’aurez terminé, vous serez donc en mesure de l’utiliser dans vos propres applications. En outre, si vous recherchez un poste dans l’IA, vous aurez la capacité de répondre à des questions de base posées lors d’entretiens.

Il s’agit du premier cours de la Spécialisation Deep Learning.

Este curso foi concebido para proporcionar uma vista geral das redes informáticas. Vamos abordar desde os princípios básicos das tecnologias e protocolos de redes modernos até aplicações práticas e resolução de problemas de rede. Para terminar, vamos abordar o modo como estas informações podem surgir numa entrevista de emprego e dar-lhe algumas sugestões para resolver problemas no local.

No final deste curso, será capaz de:
● Descrever redes informáticas em termos de um modelo de cinco camadas;
● Compreender todos os protocolos padrão envolvidos nas comunicações TCP/IP;
● Compreender ferramentas e técnicas poderosas de resolução de problemas de rede;
● Adquirir conhecimentos sobre serviços de rede como DNS e DHCP, que ajudam ao funcionamento das redes informáticas;
● Compreender a cloud computing, tudo como um serviço e o armazenamento na nuvem.

In this course, part of the Algorithms and Data Structures MicroMasters program, you will learn basic algorithmic techniques and ideas for computational problems, which arise in practical applications such as sorting and searching, divide and conquer, greedy algorithms and dynamic programming.
This course will cover theories, including:
how to sort data and how it helps for searching;
how to break a large problem into pieces and solve them recursively;
when it makes sense to proceed greedily;
how dynamic programming is used in genomic studies.
You will practice solving computational problems, designing new algorithms, and implementing solutions efficiently (so that they run in less than a second).

The world and internet are full of textual information. We search for information using textual queries and read websites, books and e-mails.
These are all strings from a computer science point of view. To make sense of all this information and make search efficient, search engines use many string algorithms. Moreover, the emerging field of personalized medicine uses many search algorithms to find disease-causing mutations in the human genome.
In this course, part of the Algorithms and Data Structures MicroMasters program, you will learn about:
suffix trees;
suffix arrays;
how other brilliant algorithmic ideas help doctors to find differences between genomes;
power lightning-fast Internet searches.
